replaceInTempl1 :: Char -> String -> [(String, Info)] -> [(String, Info)]
                    -> [(String, Info)]
replaceInTempl1 old new res (s : ss) = replaceInTempl1 old new res' ss
    where   newStr = replace1 old new [] (fst s)
            newInfo = case (snd s) of
                        MP mps -> MP (replace1 old new [] mps)
                        AxHypo -> snd s
            res' = res ++ [(newStr, newInfo)]
replaceInTempl1 _ _ res [] = res

replaceInTempl2 :: Char -> Char -> String -> String -> [(String, Info)] 
                    -> [(String, Info)] -> [(String, Info)]
replaceInTempl2 old1 old2 new1 new2 
            res (s : ss) = replaceInTempl2 old1 old2 new1 new2 res' ss
    where   newStr = replace2 old1 old2 new1 new2 [] (fst s)
            newInfo = case (snd s) of
                        MP mps -> MP (replace2 old1 old2 new1 new2 [] mps)
                        AxHypo -> snd s
            res' = res ++ [(newStr, newInfo)] 
replaceInTempl2 _ _ _ _ res [] = res

replaceInTempl3 :: Char -> Char -> Char -> String -> String -> String
                    -> [(String, Info)] -> [(String, Info)] 
                    -> [(String, Info)] 
replaceInTempl3 old1 old2 old3 new1 new2 new3
                res (s : ss) = replaceInTempl3 old1 old2 old3
                                                new1 new2 new3 res' ss
    where   newStr = replace3 old1 old2 old3 new1 new2 new3 [] (fst s)
            newInfo = case (snd s) of
                        MP mps -> MP (replace3 old1 old2 old3 
                                                new1 new2 new3 [] mps)
                        AxHypo -> snd s
            res' = res ++ [(newStr, newInfo)]
replaceInTempl3 _ _ _ _ _ _ res [] = res

proveBin :: BinaryOperation -> (String, Bool) -> (String, Bool) 
            -> [(String, Info)]
proveBin Impl (a, valA) (b, valB) = case (valA, valB) of
                                        (False, False) -> replaceInTempl2 'A' 'B' 
                                                                a b [] implFF
                                        (False, True)  -> replaceInTempl2 'A' 'B' 
                                                                a b [] implFT
                                        (True, False)  -> replaceInTempl2 'A' 'B' 
                                                                a b [] implTF
                                        (True, True)   -> replaceInTempl2 'A' 'B' 
                                                                a b [] implTT
proveBin Disj (a, valA) (b, valB)  = case (valA, valB) of
                                        (False, False) -> replaceInTempl2 'A' 'B' 
                                                                a b [] orFF
                                        (False, True)  -> replaceInTempl2 'A' 'B' 
                                                                a b [] orFT
                                        (True, False)  -> replaceInTempl2 'A' 'B' 
                                                                a b [] orTF
                                        (True, True)   -> replaceInTempl2 'A' 'B' 
                                                                a b [] orTT
proveBin Conj (a, valA) (b, valB) = case (valA, valB) of
                                        (False, False) -> replaceInTempl2 'A' 'B' 
                                                                a b [] andFF
                                        (False, True)  -> replaceInTempl2 'A' 'B' 
                                                                a b [] andFT
                                        (True, False)  -> replaceInTempl2 'A' 'B' 
                                                                a b [] andTF
                                        (True, True)   -> replaceInTempl2 'A' 'B' 
                                                                a b [] andTT

proveUn :: (String, Bool) -> [(String, Info)]
proveUn (a, valA) = case valA of
                        False -> replaceInTempl1 'A' a [] eF
                        True  -> replaceInTempl1 'A' a [] eT

